    const {name, date, sport, id, soreness} = props
    return (
        <div className="Athlete" key={id}>
                <h1>{name}</h1>
                <h2>{date}</h2>
                <h3>{sport}</h3>
                <h4>{soreness}</h4>
        {/* <Link to={`/athletes/${id}`}><button>Go to Athlete Details Page</button></Link> */}
        </div>
    )
}

export default Athlete;
